import React from 'react';
import Tilt from 'react-tilt';
import './Logo.css';
import brain from './brain.png';

const Logo = () => {
  return (
    <div className='ma4 mt0'>
      <Tilt
        className='Tilt br2 shadow-2'
        options={{ max: 55 }}
        style={{ height: 150, width: 150 }}
      >
        <div className='Tilt-inner pa3'>
          <img
            src={brain}
            alt='logo'
            style={{
              paddingTop: '5px',
              height: 100,
              width: 100,
              borderRadius: 150 / 2,
            }}
          ></img>{' '}
        </div>
      </Tilt>
    </div>
  );
};

export default Logo;
